pragma solidity 0.6.2;
import "./ERC721Tradable.sol";
import "openzeppelin-solidity/contracts/access/Ownable.sol";
/**
 * @title Wizard Boner
 * Wizard Boner - a contract for my non-fungible boners.
 */
contract Turd is ERC721Tradable {
  constructor(address _proxyRegistryAddress) ERC721Tradable("Wizard Boners", "WBNR", _proxyRegistryAddress) public { }

  function baseTokenURI() public view returns (string memory) {
    return "https://ipfs.io/ipfs/";
  }

  function contractURI() public view returns (string memory) {
    return "https://ipfs.io/ipfs/Qmb8DKgeCwxQs2ieQNWSVNjMurrdUqPduRwNRaxoedctGz";
  }
}
